import React from "react";

const App = (props) => {
  const elements =
    ((
      <input
        id={props.id}
        type={props.type}
        placeholder={props.placeholder}
        // onChange={Handlechange}
        // value={}
      />
    ),
    (
      <textarea
        id={props.id}
        placeholder={props.placeholder}
        // onChange={Handlechange}
      />
    ));

  return <div></div>;
};

export default App;
